export const FOURSEAM = { name: '4Seamer',
    description: '85-105 mph | Fastest, straightest pitch. Little to no movement.',
    photo: '/pitches/4seamfastball.png',
}
export const TWOSEAM = { name: '2Seamer',
    description: '80-90 mph | Also known as a Sinker. Moves downward, and depending on the release, will sometimes run in on a right handed hitter',
    photo: '/pitches/2seam.png',
}

